s excessively awkward to mention it now, With the Snark, so to speak, at the door! \u201CWe should all of us grieve, as you well may believe, If you never were met with again-- But surely, my man, when the voyage began, You might have suggested it then? \u201CIt\u2019s excessively awkward to mention it now-- As I think I\u2019ve already remarked.\u201D And the man they called \u201CHi!\u201D replied, with a sigh, \u201CI informed you the day we embarked. \u201CYou may charge me with murder--or want of sense-- (We are all of us weak at times): But the slightest approach to a false pretence Was never among my crimes! \u201CI said it in Hebrew--I said it in Dutch-- I said it in German and Greek: But I wholly forgot (and it vexes me much) That English is what you speak!\u201D \u201C\u2019Tis a pitiful tale,\u201D said the Bellman, whose face Had grown longer at every word: \u201CBut, now that you\u2019ve stated the whole of your case, More debate would be simply absurd. \u201CThe rest of my speech\u201D (he explained to his men) \u201CYou shall hear when I\u2019ve leisure to speak it. But the Snark is at hand, let me tell you again! \u2019Tis your glorious duty to seek it! \u201CTo seek it with thimbles, to seek it with care; To pursue it with forks and hope; To threaten its life with a railway-share; To charm it with smiles and soap! \u201CFor the Snark\u2019s a peculiar creature, that won\u2019t Be caught in a commonplace way. Do all that you know, and try all that you don\u2019t: Not a chance must be wasted to-day! \u201CFor England expects--I forbear to proceed: \u2019Tis a maxim tremendous, but trite: And you\u2019d best be unpacking the things that you need To rig yourselves out for the fight.\u201D Then the Banker endorsed a blank cheque (which he crossed), And changed his loose silver for notes. The Baker with care combed his whiskers and hair, And shook the dust out of his coats. The Boots and the Broker were sharpening a spade-- Each working the grindstone in
